nes\":[],\"type\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.5em\\\">.ظهرَ وحشُ البحيرةِ وأرادَ أنْ يلتهمَ الأبناءَ -</span><br />\\n </p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\\n<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.5em\\\">.أُصيبَ الوالدُ بمرضٍ خطيرٍ فحزنَ أبناؤُهُ حزنًا شديدًا -</span></p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\\n<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.5em\\\">.تعاونَ الأبناءُ سويًّا ونفّذوا خطةَ والدِهم فقضوا على الوحشِ وجلبوا إكسيرَ الحياةِ -</span></p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\\n<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.5em\\\">.أخبرَ الوالدُ الأبناءَ عنْ خطّةٍ تساعدُهمْ في قتلِ وحشِ البحيرةِ -</span></p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\\n<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.5em\\\">.استعادَ الوالدُ صحّتهُ بعدَ شربِهِ إكسيرَ الحياةِ وفرحَ بتعاونِ أبنائِهِ -</span></p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\"},\"subContentId\":\"865392f2-6648-42b6-840b-179911052e26\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Text غير معنون\"}},\"backgroundOpacity\":0,\"multiple\":false},{\"x\":94.03449928126498,\"y\":3.294271262274904,\"width\":1.7481732151413514,\"height\":2.2749401054144704,\"dropZones\":[\"0\",\"1\",\"2\",\"3\",\"5\",\"4\"],\"type\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p style=\\\"text-align:right\\\"><span style=\\\"font-size:2.25em\\\"><span style=\\\"color:#3498db\\\">١</span></span></p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Text غير معنون\"},\"subContentId\":\"3f617d30-0b30-49f4-8ea1-33b2f8233321\"},\"backgroundOpacity\":0,\"multiple\":fals :right\\\"> </p>\\n\\n<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.5em\\\"><span style=\\\"color:#000000\\\">.</span><span style=\\\"color:#0086ff\\\">الخاتمةُ:</span><span style=\\\"color:#000000\\\"> وهنا يذكرُ التّلميذُ الحلَّ للمشكلةِ معَ ذكرِالوضعِ النّهائيِّ </span><span style=\\\"color:#0086ff\\\">-</span></span></p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\"},\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Text غير معنون\",\"authors\":[],\"changes\":[]},\"subContentId\":\"f751171b-b3f0-4ec7-9799-a8d90bbc0b2e\"},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.1415525114155252,\"y\":82.1917808219178,\"width\":7.990867579908676,\"height\":14.202820903094874,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"decorative\":false,\"contentName\":\"الصورة\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAdIAAAHSCAYAAAEvZ3qgAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAAFxEAABcRAcom8z8AAH90SURBVHhe7Z0HmCxF1feb14QoiAJGQKIKKooEs/iZXrMCkkRQQFBRVETEPN6dru7ZG7hcJIgJA4iCiAKiV0CQZEIk+ErOOYebd6dOf+dUV++dma2e6Z7YM/P/Pc9/Z6enqjpV1alcXt9YRE/zQvqQF+iLvCCK4k/az1tAT7cuhpRFtIE3V26oDVXkc/rdNqSCUoqePPviibwTozWti9YoemJWGJPLXmh/LQA+vafu4nza1/7SGRO0VV24ihbbXwZEciEhq5fMs+cRTdC29mifMOnKqp8k5+zbeZOT+dGr7ZH+k1xDKVrLHukyiraeOUkRSK5F6SvtkS7h0ykmYDEnRWKS7jTXJcmqK/j6l/FTpJX2SLEI6ZPdeRFJ1J2kJfZIManQnvaF3GyPtEFXnlifUPo6c71h9Gx7JAfmSQ3JjSaIvc99zYkdHUZyvyRxPEg72inmhunL9lsTcj+ZApLpHiam3zv0N5og96HoIfvNgThot1C/oGAPKaBH01/cQdFT2n6rAdvhIsYIuaaASvZbDeaHNi64tvpVNFKvSw7mrXhLS0QSoDPQAjDruhRtkPtiFd1fd6N5/fcLuS5Ff7PfmKRxLCtHWveNKiKzSlXmYjlKZkHRXXU3WBSlEepj63+XL5IbtyLQD9SdoEhqRt3vrRwLipbWBV40NUN+n6S145b6lo71v+oCLqKaIb8rOovfWPThpo59Xew3mqgZ8rspGSp9capjFV1eF2CR5UVr2KuejfxubnbGcQPB1A4zvw2DmjHjJulVc1Gu7jfjsOhqxowb6TZs5tinD8w4LrKaIb+baCz9o60cV2jHuoCLqGbI76G+fPWXVqjpONcuqpohv8+0OrZynODTC+pOUCQ1o+53+SIdwVnwaf
